('vote_success', '<p>Thank you for using Intore Voting System to cast your vote! Your vote has been submitted successfully.</p>', 'vote_page', 'Your vote is Submitted!', 'The Success Page of the Voting. This is displayed right after the voter has submitted his vote.'),
